import React, { Component } from 'react';

class BudgeIt extends Component {
  state = {
    home: false,
    category: false,
    budget: false,
    expense: false,
    weekmonth: false,
    year: false
  }

  render() {
    return (
      <div>
        <Navbar />
          <Home />
          <Category />
          <Budget />
          <Expense />
          <WeekMonth />
          <Year />
      </div>
    );
  }
}

export default BudgeIt;
